import React from 'react';
import TrendCard from './TrendCard'; // Adjust the path as needed
import styled from 'styled-components';

const Container = styled.div`
  display: flex;
  flex-wrap: wrap;
  justify-content: center;
  padding: 20px;
  gap:20px;
`;

const Heading = styled.h1`
  margin-bottom: 20px;
  font-size: 24px;
  font-weight: bold;
  text-align: center;
  width: 100%;
`;

const LikedTrendsPage = ({ likedTrends }) => {
  return (
    <Container>
      <Heading>Liked Trends</Heading>
      {likedTrends.map((trend, index) => (
        <LikedTrend key={index}>
          <TrendImage src={trend.image} alt={trend.name} />
          <h2>{trend.name}</h2>
        </LikedTrend>
      ))}
    </Container>
  );
};

export default LikedTrendsPage;
